            return;
        }

        await axios.post(
            `http://localhost:8082/api/team/accept-invitation/${invitationId}`,
            {},
            {
                headers: {
                    Authorization: `Bearer ${token}`,  // ‚úÖ JWT ÌÜ†ÌÅ∞ Ï∂îÍ∞Ä
                },
            }
        );

        alert("Ï¥àÎåÄÎ•º ÏàòÎùΩÌïòÏòÄÏäµÎãàÎã§!");
        setInvitations((prev) => prev.filter((invite) => invite.id !== invitationId));
        fetchInvitations(); // ‚úÖ Ï¥àÎåÄ Î™©Î°ù Îã§Ïãú Î∂àÎü¨Ïò§Í∏∞

    } catch (error) {
        console.error("Ï¥àÎåÄ ÏàòÎùΩ Ïã§Ìå®:", error);
    }
};

  // ‚úÖ Ï¥àÎåÄ Í±∞Ï†à Í∏∞Îä•
  const rejectInvitation = async (invitationId) => {
    try {
        const token = localStorage.getItem("token");
        if (!token) {
            alert("Î°úÍ∑∏Ïù∏Ïù¥ ÌïÑÏöîÌï©ÎãàÎã§.");
            return;
        }

        await axios.post(
            `http://localhost:8082/api/team/reject-invitation/${invitationId}`,
            {},
            {
                headers: {
                    Authorization: `Bearer ${token}`,  // ‚úÖ JWT ÌÜ†ÌÅ∞ Ï∂îÍ∞Ä
                },
            }
        );

        alert("Ï¥àÎåÄÎ•º Í±∞Ï†àÌïòÏòÄÏäµÎãàÎã§.");
        setInvitations((prev) => prev.filter((invite) => invite.id !== invitationId));
    } catch (error) {
        console.error("Ï¥àÎåÄ Í±∞Ï†à Ïã§Ìå®:", error);
    }
};


  const closePopup = () => setShowPopup(false);

  const fetchInvitations = async () => {
    try {
        const token = localStorage.getItem("token");
        if (!token) {
            console.error("üö® JWT ÌÜ†ÌÅ∞Ïù¥ ÏóÜÏäµÎãàÎã§! Î°úÍ∑∏Ïù∏Ïù¥ ÌïÑÏöîÌï©ÎãàÎã§.");
            return;
        }

        const response = await axios.get("http://localhost:8082/api/team/invitations", {
            headers: {
                Authorization: `Bearer ${token}`,  // ‚úÖ JWT ÌÜ†ÌÅ∞ Ï∂îÍ∞Ä
                "Content-Type": "application/json",
            },
        });

        console.log("‚úÖ Ï¥àÎåÄ Î™©Î°ù Î∂àÎü¨Ïò§Í∏∞ ÏÑ±Í≥µ:", response.data);
        setInvitations(response.data);  // ‚úÖ Ï¥àÎåÄ Î™©Î°ù ÏóÖÎç∞Ïù¥Ìä∏ (ÎàÑÎùΩÎêú Î∂ÄÎ∂Ñ)
        if (response.data.length > 0) {
            setShowPopup(true);  // ‚úÖ Ï¥àÎåÄÍ∞Ä ÏûàÏúºÎ©¥ ÌåùÏóÖ ÌëúÏãú
        }
    } catch (error) {
        console.error("‚ùå Ï¥àÎåÄ Î™©Î°ù Î∂àÎü¨Ïò§Í∏∞ Ïã§Ìå®:", error);
    }
};


  return (
    <nav className="navbar">
      <div className="navbar-logo">TeamVerse</div>

      {/* ‚úÖ Ï¥àÎåÄ ÌåùÏóÖ */}
      {showPopup && (
        <div className="invitation-popup">
          <h2>Ï¥àÎåÄ ÏïåÎ¶º</h2>
          <ul>
            {invitations.map((invite) => (
              <li key={invite.id}>
                <p>{invite.email}ÎãòÏù¥ ÌåÄ Ï¥àÎåÄÎ•º Î≥¥ÎÉàÏäµÎãàÎã§.</p>
                <button className="accept-btn" onClick={() => acceptInvitation(invite.id)}>ÏàòÎùΩ</button>
                <button className="reject-btn" onClick={() => rejectInvitation(invite.id)}>Í±∞Ï†à</button>
              </li>
            ))}
          </ul>
          <button className="close-btn" onClick={closePopup}>Îã´Í∏∞</button>
        </div>
      )}

      <div className="navbar-links">
        <Link to="/">Dashboard</Link>
        <Link to="/statistics">Statistics</Link>
        <Link to="/team-status">Team</Link>
        <Link to="/settings">Settings</Link>
        <Link to="/login" className="login-btn">Login</Link>
